import React, { Component } from 'react';
import './Note.css';
export default class Note extends Component {
  render() {
    return (
      <div className="Note">
        <div className="Note-header">
          <div className="Note-header-title">Note Name blah blah blah</div>
          <button id="Note-extend-button-id1" className="Note-button">▼</button>
        </div>
        <div className="Note-content">
          <div className="Note-content-thumbnail">
            thumbnail
                </div>
          <div className="Note-content-desc">
            <div className="Note-content-desc-info">The Note is abuout blab blab blah.</div>
            <div className="Note-content-time">
              <div className="Note-content-time-updated">수정된 시간</div>
              <div>동영상 이름, 동영상 시간</div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
